import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import ExploreMaterial from "./View/MainComponent/ExploreMaterial";
import Home from "./View/MainComponent/Home";
import Navbar from "./View/MainComponent/Navbar";
import Registration from "./View/MainComponent";
import Login from "./View/Registration/Login";
function Studentindex() {
  return (
    <div className="app">
      <Router>
        <Navbar />
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/exploer-Material" element={<ExploreMaterial />} />
            <Route path="/view-course" element={<Home />} />
            <Route path="/logout" element={<ExploreMaterial />} />
            <Route path="/register" element={<Registration />} />
            <Route path="/login" element={<Login />} />
            <Route path="/dashboard" element={<Dashboard />} />
          </Routes>
        </main>
        {/* <Footer /> */}
      </Router>
    </div>
  );
}

export default Studentindex;
